import React, { useEffect, useState } from 'react';

const Table = ({ table, searchTerm }) => {
  const [data, setData] = useState([]);

  useEffect(() => {
    if (table) {
      // Substitua por uma chamada real √† API
      fetch(`/api/${table}`)
        .then((res) => res.json())
        .then((data) => setData(data))
        .catch((err) => console.error(err));
    }
  }, [table]);

  const filteredData = data.filter((row) =>
    Object.values(row)
      .filter((value, key) => key !== 'status')
      .some((value) =>
        String(value).toLowerCase().includes(searchTerm.toLowerCase())
      )
  );

  const renderTable = () => {
    switch (table) {
      case 'alunos':
        return (
          <>
            <thead>
              <tr>
                <th>ID</th>
                <th>Nome</th>
                <th>CPF</th>
                <th>Regularidade</th>
                <th>A√ß√µes</th>
              </tr>
            </thead>
            <tbody>
              {filteredData.map((row) => (
                <tr key={row.id}>
                  <td>{row.id}</td>
                  <td>{row.nome}</td>
                  <td>{row.CPF}</td>
                  <td>{row.regularidade}</td>
                  <td>
                    <button onClick={() => alert(`Alterar ID: ${row.id}`)}>‚úèÔ∏è</button>
                    <button onClick={() => alert(`Excluir ID: ${row.id}`)}>üóëÔ∏è</button>
                  </td>
                </tr>
              ))}
            </tbody>
          </>
        );
      case 'disciplinas':
        return (
          <>
            <thead>
              <tr>
                <th>ID</th>
                <th>Nome</th>
                <th>C√≥digo</th>
                <th>Per√≠odo</th>
                <th>A√ß√µes</th>
              </tr>
            </thead>
            <tbody>
              {filteredData.map((row) => (
                <tr key={row.id}>
                  <td>{row.id}</td>
                  <td>{row.nome}</td>
                  <td>{row.codigo}</td>
                  <td>{row.periodo}</td>
                  <td>
                    <button onClick={() => alert(`Alterar ID: ${row.id}`)}>‚úèÔ∏è</button>
                    <button onClick={() => alert(`Excluir ID: ${row.id}`)}>üóëÔ∏è</button>
                  </td>
                </tr>
              ))}
            </tbody>
          </>
        );
      default:
        return <p>Tabela n√£o configurada.</p>;
    }
  };

  return (
    <div>
      <h2>{table ? `Tabela: ${table}` : 'Selecione uma tabela'}</h2>
      <table>
        {renderTable()}
      </table>
    </div>
  );
};

export default Table;
